    <video controls>
      <source src={yutk_bag} type="video/mp4" />
    </video>
  );

  const itemList = [...imageList, videoElement];

  return (
    <div>
      <h1>Example Component</h1>
      {itemList.map((item, index) => (
        <div key={index}>
          {typeof item === 'string' ? (
            <img src={item} alt={`Image ${index + 1}`} />
